import React from 'react';
import {useEffect} from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';


const MyCars = () => {

    const getCarsOfUser = () => {
        console.log("getCarsOfUser()");
    }

    useEffect(() => {
        getCarsOfUser();
    },[]);





    return (
        <>
            <Grid container spacing={1} style={{ padding: '50px', width: "100%" }}>
                {cars.map((car) => (
                    <Grid key={car._id} item xs={12} sm={4} >
                        <Card container style={{ backgroundColor: '#f1f1f1' }} car={car}>
                            <CardActionArea onClick={() => { handleClick(car); }} >
                                <CardMedia
                                    component="img"
                                    height="240"
                                    image={car.carImages}
                                    alt="Car img"
                                />
                                <CardContent>
                                    <Typography gutterBottom variant="h5" component="div">
                                        {car.model}
                                    </Typography>
                                    <Typography variant="body2" color="text.secondary">
                                        <b> Brand Name :</b> {car.brand}
                                    </Typography>
                                    <Typography variant="body2" color="text.secondary">
                                        <b> Model Name :</b> {car.model}
                                    </Typography>
                                </CardContent>
                            </CardActionArea>
                        </Card>
                    </Grid>
                ))}

            </Grid>

        </>
    )
}

export default MyCars;
